import React, {useState} from 'react';
import axios from 'axios';


function Register() {
  const [body, setBody] = useState({
    username: "",
    password: ""
  });
  function changeBodyInfo(e) {
     setBody({...body, [e.target.className]:e.target.value})
     console.log(body)
  }
  function RegisterSubmit() {
    console.log(body)
    axios.post('http://localhost:8080/users/register', body, {headers: {'Content-Type': 'application/json'}})
    .then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
  }
  return(
    <div className="Register">
      <input type="text" className = "username" value={body.username} onChange = {changeBodyInfo}/>
      <input type="password" className = "password" value={body.password} onChange = {changeBodyInfo}/>
       <button className="submit" onClick = {RegisterSubmit}><strong>Log In</strong></button>
    </div>
  )
}

export default Register;
